# There are many types of javascript for loops

Here are some of the for loops covered in this artical

1. classic for loop `(for (;;;) {})`
2. for in loop
3. forEach() loop
4. for of loop
5. while loop

On To The Main Part.
Here is an explanation for each for loop

### Classic For Loop
```js
for (let i = 0; i < array.length; i++) {
  const item = array[i];
  // ...
}
```

In this loop, we take each index and get the item corresponding to the index
another way which is faster in IE8 is caching the array length like so
```js
for (let i = 0, l = array.length; i < l; i++) {
  const item = array[i];
  // ...
}
```

### For In Loop
```js
for (let i in array) {
  const item = array[i];
  // ...
}
```

In this one, we are looping over the keys of the array, which is slower and means that unique keys will be looped over to, like so
```js
const array = [];
array.foo = 'bar';
for (let i in array) {
  console.log(array[i]);
}

// bar
```

### .forEach() loop
```js
array.forEach((item, i) => {
  // ...
});
```

In this one, we pass in a function that receives the item and index, which makes it a bit more consise

### while loop
```js
let i = array.length;
while (--i) {
  const item = array[i];
  // ...
}
```

Of course you should never use this loop. It is slow and terrible compared to the others.

### for of loop

Finally, my favourite loop (also the slowest)
```js
for (const item of array) {
  // ...
}
```

Pretty self explanatory

Any Questions? Post a comment. Thanks.
